(4, 1, '2016-02-26 10:30:56', '2016-02-26 10:30:56', '<p>Your Name (required)<br />\n    [text* your-name] </p>\n\n<p>Your Email (required)<br />\n    [email* your-email] </p>\n\n<p>Subject<br />\n    [text your-subject] </p>\n\n<p>Your Message<br />\n    [textarea your-message] </p>\n\n<p>[submit "Send"]</p>\nsite "[your-subject]"\n[your-name] <wordpress@192.168.9.49>\nFrom: [your-name] <[your-email]>\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n--\nThis e-mail was sent from a contact form on site (your_website_url_here)\nmail@mail.com\nReply-To: [your-email]\n\n0\n0\n\nsite "[your-subject]"\nsite <wordpress@192.168.9.49>\nMessage Body:\n[your-message]\n\n--\nThis e-mail was sent from a contact form on site (your_website_url_here)\n[your-email]\nReply-To: mail@mail.com\n\n0\n0\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2016-02-26 10:30:56', '2016-02-26 10:30:56', '', 0, 'your_website_url_here/?post_type=wpcf7_contact_form&p=4', 0, 'wpcf7_contact_form', '', 0),
