(1983, 1, '2014-05-29 09:09:36', '2014-05-29 09:09:36', '<div>\n<h2>Shipments and returns</h2>\n<h5>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS.</h5>\nExtra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.\n<ul>\n	<li>Lorem ipsum dolor sit amet</li>\n	<li>Consectetur adipisicing elit, sed do eiusmod tempor</li>\n	<li>Incididunt ut labore et dolore magna aliqua</li>\n	<li>Ut enim ad minim veniam, quis nostrud</li>\n	<li>Exercitation ullamco laboris nisi ut aliquip</li>\n</ul>\nShipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.Boxes are amply sized and your items are well-protected.\n\n</div>\n<div>\n<h2>Your pack shipment</h2>\n<h5>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS.</h5>\nExtra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.\n<ul>\n	<li>Exercitation ullamco laboris nisi ut aliquip</li>\n	<li>Lorem ipsum dolor sit amet</li>\n	<li>Consectetur adipisicing elit, sed do eiusmod tempor</li>\n	<li>Incididunt ut labore et dolore magna aliqua</li>\n	<li>Ut enim ad minim veniam, quis nostrud</li>\n</ul>\nShipping fees include handling